import { Component } from "react";
import Title from '../components/widgets/title';
import Para from '../components/widgets/paragraph';
import Profile from '../components/widgets/profile';

export default class Main extends Component {
    render() {
        return (
            <div class="center Glass-plate main">
                <Title title="SociaLod" align="bold h1" />
                <Para cont=" &emsp;&emsp;Lorem ipsum dolor sit, amet consectetur adipisicing elit. Error voluptas sunt, molestias dolores eligendi recusandae blanditiis rerum! Provident nemo libero illo sapiente numquam, magni quae! Blanditiis debitis distinctio dolor explicabo!" />
                <Profile src="./public" align="left-bottom" />
            </div>
        );
    }
}
